        return (
        <div className="container">
            <ul>
                <li><a href="#calculator" id="sample" onClick={() => this.handleClick("calculator")}>Calculator</a></li>
                <li><a href="#data" id="sample" onClick={() => this.handleClick("data")}>Data</a></li>
            </ul> 
        </div>
            );
    }
}
 
export default BottomNav;
